import './App.css';
import { AppCard } from './AppCard'
import { Images } from './img/images.js'

export function AppList() {
    return (
      <div className="grid">
        hello word2
        <AppCard img={Images.pic1} text={'There are two ways of spreading light: to be the candle or the mirror that reflects it'}/>
        <AppCard img={Images.pic2} text={'You do not find the happy life. You make it.'}/>
        <AppCard img={Images.pic3} text={'The most wasted of days is one without laughter.'}/>
        <AppCard img={Images.pic4} text={'Stay close to anything that makes you glad you are alive'}/>
        <AppCard img={Images.pic5} text={'Make each day your masterpiece'}/>
        <AppCard img={Images.pic6} text={'Happiness often sneaks in through a door you didn’t know you left open.'}/>
      </div>
    )
}
